O_UAT}\"\n    cp \"${GOOGLESERVICE_INFO_UAT}\" \"${PLIST_DESTINATION}\"\nelif [ \"${CONFIGURATION}\" == \"preprod\" ]\nthen\n    # Make sure the preprod version of GoogleService-Info.plist exists\n    echo \"Looking for ${GOOGLESERVICE_INFO_PLIST} in ${GOOGLESERVICE_INFO_PREPROD}\"\n    if [ ! -f $GOOGLESERVICE_INFO_PREPROD ]\n    then\n        echo \"No PreProd GoogleService-Info.plist found. Please ensure it's in the proper directory.\"\n        exit 1\n    fi\n\n    echo \"Using ${GOOGLESERVICE_INFO_PREPROD}\"\n    cp \"${GOOGLESERVICE_INFO_PREPROD}\" \"${PLIST_DESTINATION}\"\nelif [ \"${CONFIGURATION}\" == \"prod\" ]\nthen\n    # Make sure the prod version of GoogleService-Info.plist exists\n    echo \"Looking for ${GOOGLESERVICE_INFO_PLIST} in ${GOOGLESERVICE_INFO_PROD}\"\n    if [ ! -f $GOOGLESERVICE_INFO_PROD ]\n    then\n        echo \"No Production GoogleService-Info.plist found. Please ensure it's in the proper directory.\"\n        exit 1\n    fi\n\n    echo \"Using ${GOOGLESERVICE_INFO_PROD}\"\n    cp \"${GOOGLESERVICE_INFO_PROD}\" \"${PLIST_DESTINATION}\"\nelse\n    # Make sure the dev version of GoogleService-Info.plist exists\n    echo \"Looking for ${GOOGLESERVICE_INFO_PLIST} in ${GOOGLESERVICE_INFO_DEV}\"\n    if [ ! -f $GOOGLESERVICE_INFO_DEV ]\n    then\n        echo \"No Dev GoogleService-Info.plist found. Please ensure it's in the proper directory.\"\n        exit 1\n    fi\n    echo \"Using ${GOOGLESERVICE_INFO_DEV}\"\n    cp \"${GOOGLESERVICE_INFO_DEV}\" \"${PLIST_DESTINATION}\"\nfi\n";
